    const [code, setCode] = useState();

    const [color, setColor] = useState({
        color1: 'yellow',
        color2: 'blue',
        color3: 'red',
        color4: 'orange'
    });

    const updateColor = () => {
        setColor((prevColor) => {
            return { ...prevColor, color1: 'black' };
        })
    }

